    @Test
    public void test_5() throws Exception {
        
        given().accept("application/json")
                .contentType("application/json")
                .body(" { " + 
                    " \"query\": \"  { markdown  (text : \\\"ONnG0fw\\\")  {html}       } \" " + 
                    " } ")
                .post(baseUrlOfSut)
                .then()
                .statusCode(200)
                .assertThat()
                .contentType("application/json")
                .body("'data'.'markdown'.'html'", containsString("<p>ONnG0fw</p>\n"));
    }
    
    
